import React from "react";
import Table from 'react-bootstrap/Table';
import AirData from './AirData';

const factors = () => {
    console.log("WHAT",AirData);
    return (
        <div>
            <Table bordered>
                <thead>
                    <tr>
                        <th>Flight Name</th>
                        <th>Departure Location</th>
                        <th>Wind Speed</th>
                        <th>Holidays</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>{AirData.name[0]}</td>
                    </tr>
                </tbody>
            </Table>
        </div>
    );
}
export default factors;
